  // Lista de películas
  const [movieList, setMovieList] = useState([]);
  // estado paginación
  const [page, setPage] = useState(1);

  useEffect(() => {
    // función asíncrona
    (async () => {
      const response = await fetch(
        `${URL_API}/movie/now_playing?api_key=${API}`
      );
    })();
  }, [page]);

  return <div>Estamos en NewMovies</div>;
};

export default NewMovies;
